export default {
  template: `
    <div class="store-navigation__logo special" v-html="getInner"></div>
    `,
  props: {
    title: {
      type: String
    },
    image: {
      type: String
    }
  },
  computed: {
    getInner() {
      let content = ``;
      if (this.image !== undefined) content += this.image;
      if (this.title !== undefined) content += `<p>${this.title}</p>`;
      return content;
    }
  }
};
